import React from "react";
import "./style.css";
import { Button, Image, Modal } from "semantic-ui-react";
import {CartHelper} from "../../utils/action";

class Cart extends React.Component {
    constructor(props){
        super(props);

        this.state = {
            products: CartHelper.getCart()

        }
    }
  render() {
      console.log
    return (
        <div className="cart-modal">
      <Modal
        trigger={<i className="fas fa-shopping-cart" id="shopping-icon" />}
      >
        <Modal.Header>Your Cart</Modal.Header>
        <Modal.Content image>
          <Image wrapped size="" src="" />
          <Modal.Description />
        </Modal.Content>
      </Modal>
      </div>
    );
  }
}

export default Cart;
